%[text] ## Construction of phasor Array
%[text] ## Intro
%[text] The phasorArray class is a usefull tool to manipulate 3D array representing Periodic matrix, storing complex phasor along the third dimension. Obligatory, third dimension must me an odd number. 
%[text] Let's use the class PhasorArray to attach usefull function to a 3D matrix representing a periodic matrix and its phasor.
%[text] Consider A a 3D array of size $2h+1$ , A(:,:,h+1) is the 0-phasor of A, $A(:,:,(h+1)-m)$ and $A(:,:,(h+1)+m)$ are the $-m$ and $m$ phaors of A. 
%[text] The class allow construction, manipulation, edition of phasor in a smooth manner, and redifine all the basic operation (addition, substraction, multiplication, left/right inversion, transposition, conj transpore, real, imag ....) to apply to the periodic matrix instead of the array operation. 
%[text] 
%[text] 
%[text] ### Construting a phasorArray
A_0=eye(2);
A_1=[1 1i;-1i,2];
A_2=[2*1i, exp(1i*1.89)/4; 0.5, -1];

A_ar=cat(3,conj(A_2),conj(A_1),A_0,A_1,A_2);
A=PhasorArray(A_ar) %[output:1bbfabf4]
%[text] Alternatively, specify that A represent a real valued periodic matrix, ie negative phasor are the conjugate of positive phasor, and feed the function only with the Zero and Positive part, and speficify the argument 'isreal' to true
A_arpos=cat(3,A_0,A_1,A_2);
A=PhasorArray(A_arpos,'isreal',true) %[output:2d29d716]
%[text] The last way to construct PhasorArray is to specifiy individual periodic coefficient.
%[text] For that you can avoid the hassle to construct a 3D matrix, and provide a vector in order to define a scalar periodic PhasorArray. Using this, individual coeef can have different number of phasor but can still concatenate
a_11=ScalarPhasorArray([1,1,2*1i],'isreal',true) %[output:8b11a407]
a_12=ScalarPhasorArray([0,1i,exp(1i*1.89)/4, 1/7, 1/8*1i ],'isreal',true) %[output:32b0ca01]
a_21=ScalarPhasorArray([0,-1i,0.5],'isreal',true) %[output:0e2f9db3]
a_22=ScalarPhasorArray([1,2,-1],'isreal',true) %[output:50ab493d]

A=[a_11,a_12;a_21,a_22] %[output:259311a6]
%[text] ### Display phasorArray
%display the 3D array
A.value %[output:4a9b0578]

%stem plot
figure %[output:9d462b97]
clf %[output:9d462b97]
stem(A,display="real",scale="linear") %[output:9d462b97]
sgtitle('Stem of real part of Phasor of A') %[output:9d462b97]

figure %[output:23cddf76]
clf %[output:23cddf76]
stem(A,display="imag",scale="linear") %[output:23cddf76]
sgtitle('Stem of imag part of Phasor of A') %[output:23cddf76]

figure %[output:97c5ded7]
clf %[output:97c5ded7]
stem(A,display="abs",scale="linear") %[output:97c5ded7]
sgtitle('Stem of abs value of Phasor of A') %[output:97c5ded7]

%temporal plot
figure %[output:8486e746]
clf %[output:8486e746]
plot(A,2,0:0.001:4,"title",'A(t)') %[output:8486e746]

figure %[output:485a7cad]
barsurf(A) %[output:485a7cad]

figure %[output:062f1b10]
stem(A,"explosed",0,"scale","linear") %[output:062f1b10]
%%
%[text] ### Perform derivation and phase shift
figure %[output:842a0196]
plot(d(A,2),2,0:0.001:4,"title","A(t)'") %derivative of A, for a period T=2 %[output:842a0196]

figure %[output:0551dc50]
plot(dephase(A,pi/2),2,0:0.001:4,"title","A(t+T/4)") %dephasage de A de pi/2 rad %[output:0551dc50]
%[text] ### Edit PhasorArray
%[text] You can modify value of PhasorArray by two means
%[text] Access 3D array using parenthesis to manipulate it as a 3D array in regular matlab way
A(1,1,3)=5 % access the third page of 3D array, since A is of size 5, %[output:9b3030d8]
% the 3rd page is the central page,
% so it is the 0 phasor,
%  since we specify (1,1,3) we edit the value of the first coeeficient of
%  A(t)

A(1,1,(A.h+1)+0) = 5 %A.h produces the number of phasor in A %[output:487b826d]
% so (A.h+1)+k is the index of the k-th phasor page
%[text] Alternatively **use bracket with 2 indices** to access coefficient subphasor array, you can use bracket indexing to totaly replace phasor value of specified coefficients
A{1,1} %extract the phasor Array of (1,1) element of A(t) %[output:7f848edd]
figure %[output:7e92f9aa]
plot(A) %[output:7e92f9aa]

figure %[output:70fd87e2]
plot(A{1,1}) %[output:70fd87e2]

A{1,1}=9;
hold on %[output:70fd87e2]
plot(A{1,1}) %[output:70fd87e2]

A{1,1}=ScalarPhasorArray([5 1/2*1i],'isreal',true); %replace a_11 with 5-sin(wt)
hold on %[output:70fd87e2]
plot(A{1,1}) %[output:70fd87e2]
%[text] You can also **use bracket with 3 indices** to assign to specific phasor BUT <u>unlike parenthesis indexing</u> the third argument is a phasor indices 
%[text] - A{1,2,3} access the third phasor of $a\_{12}$ in the same way A(1,1,3+1+A.h) does
%[text] - A{1,1,-3} is a licit indexing
%[text] - if k is too big (k \> A.h) the output is zero \
A{1,1,1} %[output:70c9899a]
A(1,1,1+1+A.h) %[output:803826c3]
A{1,1:2,7} %[output:181d93ed]
A{:,:,-4} %[output:53e4c08e]

%change value of phasor -3 of a_11 and a_12
A{1,1:2,-3}=[1/4*1i 1/3+1i/5]  %[output:9d6d8952]
%[text] To access full phasor of  order k, an alternative to A{:,:,k} is A.phas(k)
A.phas(-3) %[output:0e224731]
%[text] finally use A{:} to extract a vector form of A
A{:} %[output:10a9ea0f]
figure %[output:8acf64ff]
plot(A{:}) %[output:8acf64ff]

