%[text] ### Basic manipulation
%[text] We want to manipulate the 3D array (Phasor Array) as is they are matrices. Hence we redefine the + \* .\* / ./ ' .' operateur to produce result on the periodic matrices. 
%[text] A+4 (addition with a scalar) adds 4 only to the 0 phasor, C=A\*B realise the product of the periodic matrices st $C(t)=A(t)B(t)$, the is element wise product too : C=A.\*B means $c\_{kl}(t) = a\_{kl}(t) b\_{kl}(t)$ and so on for matrix division and element wise division. 
%[text] PhasorArray class define the addition in the sens of Matrix : AA=A+4 adds 4 only to the 0 phasor of A 
AA=A+8*eye(2) %[output:720ee6c1]
figure %[output:34fc56c1]
plot(A) %[output:34fc56c1]
hold on  %[output:34fc56c1]
plot(AA) %[output:34fc56c1]


B=1/AA;
figure %[output:3ca15720]
plot(B,title='B(t)') %[output:3ca15720]
hold on  %[output:3ca15720]
plot(B*AA,title='B(t)*AA(t)')  %[output:3ca15720]

C=rand_phasor(2,2,5,"output","PhasorArray","time_structure","real") %[output:1ac30c9e]
figure %[output:2cb5879a]
plot(C,title='C(t)') %[output:2cb5879a]
figure %[output:70a7e9fb]
stem(C) %[output:70a7e9fb]
figure %[output:179c9240]
plot(A*C,title='product A(t) \times C(t)') %[output:179c9240]


figure(11)
clf
stem(A*C) %[output:70a7e9fb]
figure %[output:83c32c0e]
clf %[output:83c32c0e]
plot(A.') %transpose et complexe transpose fonctionnent %[output:83c32c0e]
hold on %[output:83c32c0e]
plot(A) %[output:83c32c0e]

%[text] You can perform smoothly addition and substraction of phasor array containing a different number of phasor as long as the first two dimmension are compatible
D=rand_phasor(2,2,4) %[output:5762f76c]
E=A-D %[output:5bd167a9]

F=kron(A,D) %[output:0f47cc4d]
%[text] Basic function such as sum, trace, diag etc are available
diag(A) %[output:8112f30c]
figure %[output:4fb01af9]
plot(diag(A)) %[output:4fb01af9]

trace(A) %[output:96bb109e]
figure %[output:54cb431b]
plot(trace(A)) %[output:54cb431b]

%[text] N.B. notice that $trace(\\mathcal{T}\_m(A))=\\frac{trace(A(t)\_0)}{2m+1}$
%[text] 
%[text] Power are defined
figure %[output:9d40a6c5]
plot(A) %[output:9d40a6c5]
figure %[output:989ec562]
plot(A^3) %[output:989ec562]
figure %[output:9734304d]
plot(A.^5) %[output:9734304d]
