%[text] ## Simulation of system
%[text] Lets take a random periodic matrix with imposed eigen value on S-N
figure %[output:6b32004a]
S=mreal(rand_phasor(2,2,7,"hurwitzeig",[-1 -0.3],"time_structure","hurwitz",output="PhasorArray")) %[output:2df0e514]

tmax=15;
T=1 %[output:475ba31b]
x0=rand(2,1);
[t,y]=lsim(S,tmax,x0,T,"plot",true,"checkreal",1);  %[output:6cc2a82e] %[output:6b32004a]
%check real ensure only real value are used, tune this argument to true if
%the periodic matrices are real valued
title('x(t)') %[output:6b32004a]

figure %[output:079bd3ed]
plot(S{:},T,0:0.01:tmax,title='S(t)') %[output:079bd3ed]

figure %[output:9e0b0c87]
plot(S.HmqNEig([],T),'*') %[output:9e0b0c87]
title('eig(S-N)') %[output:9e0b0c87]

%[text] We now add an input to the simulation
B=rand_phasor(2,1,5,"time_structure","real",output="PhasorArray") %[output:4e295877]
figure %[output:089ef3e2]
plot(B,T,0:0.01:tmax) %[output:089ef3e2]

figure %[output:0ae5c423]
[t,y]=lsim(S,tmax,x0,T,B,"plot",true,"checkreal",1); %[output:6130dcef] %[output:0ae5c423]
title('x(t)') %[output:0ae5c423]

