%[text] ## Harmonic Array
%[text] Construct the Toeplitz Block Form and BlockToeplitz form of order h using the BT and TB method
h=5 %[output:5602c65f]

%TB and BT matrix
A.TB(h) %[output:578a65d3]
A.BT(h) %[output:699814f6]

%en version sparse
A.spBT(h) %[output:5b0df3c8] %[output:5ecb5f6f]
A.spTB(h) %[output:06af72fd]

T=1 %period %[output:98c532ea]
nx=2 %number of state %[output:21152221]
NTB(nx,h,T) %[output:33fadb3e]
NBT(nx,h,T) %[output:35c19d76]

spNBT(nx,h,T) %[output:5cf07011]
spNTB(nx,h,T) %[output:1058c3dd]

%[text] The 'N' function accept a phasorArray as first argument and deduce from the first dimension of the matrix the number of state
NTB(A,h,T) %[output:3f844343]
%[text] to compute the square hankel form used in LMI use
%[text]  \[$\\mathcal{H}\_{m,m}(A^+)\\mathcal{J}\_{m,m},\\mathcal{J}\_{m,m}\\mathcal{H}\_{m,m}(A^-),\\mathcal{H}\_{m,m}(A^+),\\mathcal{H}\_{m,m}(A^-)\]=A.TBHankel(h);$
%[text] BT hankel is not yet implemented
[HpJ,JHm,Hp,Hm]=A.TBHankel(h);
% [HpJ,JHm,Hp,Hm]=A.BTHankel(h); 

%sparse versions
[HpJ,JHm,Hp,Hm]=A.spTBHankel(h);
%[text] compute eigenvalue of A and eigen value of A-N
A.HmqNEig(h,T) %[output:1ad0f760]
A.HmqEig(h) %[output:83f253be]

%[text] Output sincos form, imag real form etc in the form of 3D array
u=ScalarPhasorArray([1 1/2 -1/2/1i],"isreal",1) %[output:5b60fca3]
% u = 1 + cos - sin
figure %[output:565156de]
plot(u,1,0:0.01:2,title='u') %[output:565156de]

u.SinCosForm %[output:20cf657d]
u.ImagRealForm %[output:313a7dad]
