%[text] ## Lyapunov and Sylvester eq
%[text] $\\dot{M\\left(t\\right)} +A\\left(t\\right)\\;M\\left(t\\right)+M\\left(t\\right)\\;B\\left(t\\right)+C\\left(t\\right)=0,\\textrm{periodic}${"editStyle":"visual"}
A=mreal(rand_phasor(4,4,7,"hurwitzeig",[-1 -0.7 -0.1 -0.3],"time_structure","hurwitz",output="PhasorArray")) %[output:32c94720]
Q=PhasorArray(eye(4));

hp=10;
T0=1;

%A^TP + PA +Q =0
P=PhasorArray(Sylv_harmonique(A',A,Q,2*hp,2*pi/T0));
figure %[output:0eb56c89]
plot(P) %[output:0eb56c89]

nx=size(A,1) %[output:7447cedc]
nz=2 %[output:8c2c5fe8]

C=PhasorArray(rand_phasor(nz,nx,4,"time_structure","real")) %[output:0bc32b46]
O=rand(nz,nz) %[output:6639fbbf]

%dotM + -OM + MA -C =0
M=PhasorArray(Sylv_harmonique(-O,A,-C,2*hp,2*pi/T0));
plot(M) %[output:600570be]

